#!/usr/bin/env node
import chalk from 'chalk';
import inquirer from 'inquirer';
import updateNotifier from 'update-notifier';
import yargs from 'yargs';

import Dokata from './';
import pkg from '../package.json';

updateNotifier({pkg}).notify();

const argv = yargs
  .usage('Usage: dokata [options] <generator_path>')
  .example('dokata /path/to/generator', 'extract template to current dir.')
  .example('dokata -o /path/to/output /path/to/generator', 'extract template to output dir.')
  .example('dokata generator_name', 'extract template to current dir (MUST: $DOKATA_TEMPLATE_DIR).')
  .example('dokata -l', 'Listing template names (MUST: $DOKATA_TEMPLATE_DIR).')
  .option('o', {
    alias: 'output-dir',
    describe: 'Set output directory path',
    type: 'string',
    'default': '.'
  })
  .option('l', {
    alias: 'list',
    describe: 'Listing template names'
  })
  .help('help')
  .version(pkg.version)
  .detectLocale(false)
  .strict()
  .wrap(null)
  .argv;


/**
 * Generate project
 *
 * @param {string} name generator name
 * @param {Object} options options
 */
function generateProject(name, options) {
  const dokata = new Dokata(process.env.DOKATA_TEMPLATE_DIR);
  const generator = dokata.createGenerator(name);
  if (generator === null) {
    throw new Error(`Does not exist generator: ${name}`);
  }
  inquirer.prompt(generator.config.questions, answers => {
    generator.updateContext(answers);
    generator.on('create:file', filepath => {
      console.log(`${chalk.gray('file')}:\t${chalk.bold(filepath)}`);
    })
    .on('create:dir', dirpath => {
      console.log(`${chalk.gray('dir')}:\t${chalk.bold(dirpath)}`);
    })
    .on('done', () => {
      console.log(chalk.green.bold('Success!'));
      process.exit();
    })
    .execute(options.outputDir);
  });
}


/**
 * List generator names
 */
function listGeneratorNames() {
  if (!process.env.DOKATA_TEMPLATE_DIR) {
    console.error(chalk.red('Please set DOKATA_TEMPLATE_DIR'));
    process.exit(1);
  }
  const dokata = new Dokata(process.env.DOKATA_TEMPLATE_DIR);
  dokata.getGeneratorConfigs().forEach(config => console.log(config.name));
  process.exit();
}


/**
 * execute
 *
 * @param {string[]} args command line arguments
 * @param {Object} options command line options
 */
function execute(args, options) {
  try {
    if (options.list) {
      listGeneratorNames();
    } else if (args.length > 0) {
      generateProject(args[0], options);
    } else {
      throw new Error('Please set generator name');
    }
  } catch (e) {
    console.error(chalk.red(e));
    process.exit(1);
  }
}

execute(argv._, argv);

import npmconf from 'npmconf';

const CONFIG_KEY_SEPARATORS = ['.', '-'];


/**
 * Return context from npm config data
 *
 * @return {Promise}
 */
export default function npm() {
  return new Promise((resolve, reject) => {
    npmconf.load((err, config) => {
      if (err) {
        console.log('npmerr', err);
        reject(err);
      } else {
        resolve(getContext(config));
      }
    });
  });
}

/**
 * Return npm context
 *
 * @param {Object} config loaded npmconf config object
 * @return {Object}
 */
export function getContext(config) {
  const author = getAuthor(config);
  return {
    author,
    formattedAuthor: formatAuthor(author),
    source: config
  };
}


/**
 * Return npm author data
 *
 * @param {Object} config loaded npmconf config object
 * @return {Object}
 */
function getAuthor(config) {
  return {
    name: getConfigValue(config, ['init', 'author', 'name']),
    email: getConfigValue(config, ['init', 'author', 'email']),
    url: getConfigValue(config, ['init', 'author', 'url'])
  };
}


/**
 * Return npm config value
 *
 * @param {Object} config loaded npmconf config object
 * @param {string[]} keys npm config keys
 * @return {string}
 */
function getConfigValue(config, keys) {
  return CONFIG_KEY_SEPARATORS.map(separator => {
    return config.get(keys.join(separator));
  }).find(val => val);
}


/**
 * Format author like `${name} <${email}> (${url})`
 *
 * @param {Object} author author object
 * @param {string|undefined} author.name author name
 * @param {string|undefined} author.email author email
 * @param {string|undefined} author.url author url
 * @return {string}
 */
function formatAuthor(author) {
  const words = [];
  words.push(author.name || '');
  words.push(author.email ? `<${author.email}>` : '');
  words.push(author.url ? `(${author.url})` : '');
  return words.filter(val => val).join(' ');
}

import {EventEmitter} from 'events';
import path from 'path';

import debugModule from 'debug';
import ejs from 'ejs';
import fs from 'fs-extra';
import walk from 'walk';

const debug = debugModule('dokata');
const CONFIG_FILE_NAME = 'dokata.json';
const TEMPLATE_DIR_NAME = 'template';


/**
 * Project Generator
 */
class Generator extends EventEmitter {

  /**
   * constructor
   *
   * @param {string} baseDir base directory path
   */
  constructor(baseDir) {
    super();
    this.baseDir = baseDir;
    this.templateDir = path.join(this.baseDir, TEMPLATE_DIR_NAME);
    this.context = {};

    this.loadConfig();
  }

  /**
   * Generate files from settings of dokata template
   *
   * @param {string} outputDir output directory path
   */
  execute(outputDir) {
    const walker = walk.walk(this.templateDir);

    fs.mkdirs(outputDir);

    walker.on('directories', (root, stats, next) => {
      const basePath = path.relative(this.templateDir, root);
      stats.forEach(stat => {
        const outputPath = path.join(basePath, stat.name);
        fs.mkdirs(path.join(outputDir, outputPath));
        this.emit('create:dir', outputPath);
      });
      next();
    });

    walker.on('file', (root, stat, next) => {
      const basePath = path.relative(this.templateDir, root);
      const outputPath = path.join(basePath, stat.name);
      const data = fs.readFileSync(path.resolve(root, stat.name));
      fs.writeFileSync(
        path.join(outputDir, outputPath),
        ejs.render(data.toString('utf8'), this.context)
      );
      this.emit('create:file', outputPath);
      next();
    });

    walker.on('errors', (root, nodeStats, next) => {
      this.emit('error:walk', root, nodeStats);
      next();
    });

    walker.on('end', () => {
      this.emit('done');
    });
  }


  /**
   * Load config from dokata config file
   */
  loadConfig() {
    const defaultConfig = {
      questions: []
    };
    this.config = Object.assign(
      {},
      defaultConfig,
      fs.readJsonSync(path.join(this.baseDir, CONFIG_FILE_NAME))
    );
  }

  /**
   * Update context
   *
   * @param {Object} context template context for generating files
   */
  updateContext(context) {
    this.context = context;
  }
}


/**
 * Project Generator
 */
export default class Dokata {

  /**
   * Constructor
   *
   * @param {string|undefined} baseDir dokata template directory path
   */
  constructor(baseDir) {
    debug('baseDir', baseDir);
    if (baseDir !== undefined) {
      this.baseDir = path.resolve(baseDir);
    }
  }

  /**
   * Get list of generator config data
   *
   * @return {Object[]}
   */
  getGeneratorConfigs() {
    if (!this.baseDir) {
      return [];
    }
    return fs.readdirSync(this.baseDir).map(filename => {
      const fp = path.join(this.baseDir, filename);
      if (!fs.statSync(fp).isDirectory()) {
        return null;
      }
      if (!fs.existsSync(path.join(fp, 'dokata.json'))) {
        return null;
      }
      return {
        path: fp,
        name: filename
      };
    }).filter(c => c !== null);
  }

  /**
   * Create Generator
   *
   * @param {string} name generator name
   * @return {Generator|null}
   */
  createGenerator(name) {
    if (this.isPath(name)) {
      return new Generator(path.resolve(name));
    }
    const config = this.getGeneratorConfigs().find(c => {
      return c.name === name;
    });
    if (config) {
      return new Generator(config.path);
    }
    return null;
  }

  /**
   * isPath
   *
   * @param {string} name generator name
   * @return {boolean}
   */
  isPath(name) {
    return /^(?:\.\.?|\~|)\//.test(name);
  }
}


export {Dokata, Generator};
